import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import { CardBasic } from "../Components/CardBasic";
import bottom from "../Restes_bildes/balts.png";
import bottom_g from "../Restes_bildes/zals.png";

import k1 from "../Restes_bildes/kreisa1.png";
import k2 from "../Restes_bildes/kreisa2.png";
import k3 from "../Restes_bildes/kreisa_istaois_3.png";
import k4 from "../Restes_bildes/kreisa3.png";

export const Floor = () => {
  const param = useParams();
  const { id } = param;
  useEffect(() => {
    // api call
    console.log("also i call something to python");
    console.log(id);
  }, [id]);

  return <>
  <div style={{ textSizeAdjust:'2rem'}}>This is Floor {id} plan</div>
    <CardBasic>
       <img style={{ position: "absolute", left: 425,top:450, transform: 'scale(0.7)'}} src={bottom} alt="Logo1" />
       <img style={{ position: "absolute", left: 495,top:450, transform: 'scale(0.7)'}} src={bottom} alt="Logo2" />
       <img style={{ position: "absolute", left: 565,top:450, transform: 'scale(0.7)'}} src={bottom} alt="Logo3" />
       <img style={{ position: "absolute", left: 635,top:450, transform: 'scale(0.7)'}} src={bottom} alt="Logo4" />
       <img style={{ position: "absolute", left: 705,top:450, transform: 'scale(0.7)'}} src={bottom} alt="Logo5" />
       <img style={{ position: "absolute", left: 775,top:450, transform: 'scale(0.7)'}} src={bottom} alt="Logo6" />
       <img style={{ position: "absolute", left: 845,top:450, transform: 'scale(0.7)'}} src={bottom} alt="Logo7" />
       <img style={{ position: "absolute", left: 915,top:450, transform: 'scale(0.7)'}} src={bottom} alt="Logo8" />
       <img style={{ position: "absolute", left: 985,top:450, transform: 'scale(0.7)'}} src={bottom} alt="Logo9" />
       <img style={{ position: "absolute", left: 1055,top:450, transform: 'scale(0.7)'}} src={bottom} alt="Logo10" />

       <img style={{ position: "absolute", left: 1055,top:300, transform: 'scale(0.7)'}} src={k1} alt="Logo10" />
       <img style={{ position: "absolute", left: 1055,top:300, transform: 'scale(0.7)'}} src={k2} alt="Logo10" />
       <img style={{ position: "absolute", left: 1055,top:300, transform: 'scale(0.7)'}} src={k3} alt="Logo10" />
       <img style={{ position: "absolute", left: 1055,top:300, transform: 'scale(0.7)'}} src={k4} alt="Logo10" />



    </CardBasic>

</>
};
